import React, { useState } from "react";

export const Closed_Toggler_Button = () => {

    const [toggle, updateToggle] = useState()
    const state = ['on','off']

    return <React.Fragment>

        
        <span id='Closed_Toggler_Button' onClick={()=>{state[0]='off'}}>
            Open Filter
        </span>
        

    </React.Fragment>

}

export default Closed_Toggler_Button;
